  return (
    <>
      <Head>
        <meta charSet="utf-8" />
        <title>NodeBird</title>
      </Head>
      <Component />
    </>
  );
};

App.proPropTypespTypes = {
  Component: PropTypes.elementType.isRequired,
};

export default App;
